/*!50003 DROP FUNCTION IF EXISTS `bayar_terakhir_baru` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `bayar_terakhir_baru`(vnpwp VARCHAR(100)) RETURNS date
BEGIN
    
	DECLARE i INT;
	DECLARE res DATE;
	SELECT COUNT(id) INTO i FROM tb_transaksi_dept WHERE npwpd=vnpwp;
	IF i >0 THEN 
		SELECT tgl_transaksi INTO res FROM tb_transaksi_dept WHERE npwpd=vnpwp ORDER BY tgl_transaksi DESC LIMIT 1;
